import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import './index.css';
import 'images/2923.jpg';

class App extends Component {
  render() {
    return (
      <div className="App">
        <head>
            <title>Bad Days: Home Page</title>
            <link rel="stylesheet" href="./index.css" type="text/css" />
        </head>
        <div class="navBar">
            <a href="index.html">Home</a>
            <a href="report.html">Statistics</a>
            <a id="register" href="register.html">Login/Signup</a>
        </div>

        <body>
            <div class="container">
                <b>
                    <div class="title">BAD DAY</div>
                    <img class="center-cropped" src="images\2923.jpg" />
                    <button class="btn1" onclick="location.href='register.html';"><b>LOGIN/SIGN-UP</b></button>          
                    <h1 class="text">OR</h1>
                    <button class="btn2" onclick="location.href='report.html';"><b>START NOW</b></button>
                </b>
            </div>     
        </body>
      </div>
    );
  }
}

export default App;
